import React from 'react';
import {Routes,Route,Router} from 'react-router-dom';
const Header = () => {
  return (
    <div>
      <nav className="p-6 flex items-center justify-between">
        <h1 className="text-2xl font-bold">EQUI</h1>
        <div className="flex gap-4">

        <Router>
          <div className="App min-h-screen bg-white">
            <header className="App-header">
              <Header />
            </header>
            {/* Route for login page */}
            <Route path="/login" element={<button className="text-gray-600 hover:text-gray-900">Login</button>} />

            {/* Route for signup page */}
            <Route path="/signup" element={<button className="bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800">Signup</button>} />
          </div>
        </Router>

    <Router/>
        </div>
      </nav>
    </div>
  );  
};

export default Header;
